import React from 'react'
import './Profile.css'

const Profile = () => {
  return (
    <div className='container shadow mt-3'>
        <div className="row">
            <div className="col-md-6">left</div>
            <div className="col-md-6">right</div>
        </div>
    </div>
  )
}

export default Profile
